script: |
  super -f text -I q2344.spq | sort > q2344.out

inputs:
  - name: q2344.spq
    data: |
      SELECT - col2 * 8 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col1 + - col1 + CAST ( 81 AS INTEGER ) * col2 NOT BETWEEN + col0 * - col2 AND col0;
  - name: tab0

outputs:
  - name: q2344.out
    data: |
